package com.example.studentapp.databaseimport androidx.room.ColumnInfoimport androidx.room.Entityimport androidx.room.PrimaryKey@Entity(tableName = "users")class UserInfo(    @ColumnInfo(name = "name")        val nameUser: String?,    @ColumnInfo(name = "score")       val score: String?,    @ColumnInfo(name = "email")       val email: String?,    @ColumnInfo(name = "urlToImage")  val urlToImage: String?,) {    @PrimaryKey(autoGenerate = true)    var id: Int? = null    override fun equals(other: Any?): Boolean {        return super.equals(other)    }}